import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));

const message = "Hiiiiiiii"
const message1 = <h2>Helllooooooo</h2>

const arr = ['Apple', 'Orange', 'Apple', 'Banana', 'pineaplle', 'Apple']
const app = arr.filter(fruit => fruit == 'Apple')
// const appp = arr.find(fruitt => fruitt == 'Apple')

const countries=['India','US','Japan']

const display=()=>{

    countries.forEach((country)=>{
        return(
          <div>
              <p>{country}</p>
          </div>
        )
    })
}

function Demo(){

  return(
    <div>
    <h1>Hello ReactJS!!!</h1>
    <p>React Demo!!!</p>
    <p>Message : {message}</p>
    {message1}
    <ul>
      {arr.map((fruit) => (
        <li>{fruit}</li>
      ))}
    </ul>

  <h1>Using filter</h1>
    <ol>
      {app.map((fruit) => (
        <li>{fruit}</li>
      ))}
    </ol>

     {display}
  </div>
  )
}

root.render(
    <Demo/>
);
